– аппликаторы для нанесения краски (бутылочка);
– шапочки для мелирования;
– лопатки для окрашивания волос;
– выжиматели тюбиков (прессы для тюбиков);
– кисти для окрашивания;
– воротники-лотки для окрашивания и масок;
– венчики для смешивания краски;
– перчатки для окрашивания;
– наборы аксессуаров для окрашивания;
– парикмахерские мерные стаканы;
– косынки для мелирования;
– шейкеры для смешивания красок;
– наушники-протекторы для защиты ушей во время окрашивания;
– защитные ватные шнуры (жгуты) для окрашивания и мелирования (защищает лицо от протекания химических средств, рекомендуется использовать вместе с полиэтиленовой косынкой).

category.notes:
1) Брюки любого фасона для девочек от з-х лет, кроме брюк для спорта: классические, легинсы, джегинсы, трегинсы, кюлоты, джоггеры, слаксы, чинос, шаровары, афгани, брюки-клеш и т.д.;
2) летние комбинезоны и полукомбинезоны, включая джинсовые и укороченные (низ в виде шортов);
3) комплекты из одинаковых предметов одежды, входящих в категорию.

По возрасту – от 3 до 16 лет.

1) Брюки для мальчиков от 3-х лет любого фасона, кроме брюк для спорта: классические костюмные брюки, дудочки, слаксы, шаровары, карго, чинос, джоггеры и т.д.;
2) вельветовые брюки;
3) трикотажные брюки не для спорта;
4) летние комбинезоны и полукомбинезоны, включая джинсовые;
5) комплекты из одинаковых предметов одежды, входящих в категорию.

По возрасту – от 3 до 16 лет.
